import React from 'react';
import HeaderNavigation from './HeaderNavigation';
import CarImage from './CarImage';
import HeroSection from '../HomePageComponents/HeroSection';
import InfoSection from './InfoSection';

const Layout = () => {
  return (
    <div style={{ width: '100%', minHeight: '100vh', display: 'flex', flexDirection: 'column', alignItems: 'center', backgroundColor: '#f5f8fa' }}>
      {/* Header Navigation */}
      <div style={{ width: '100%', display: 'flex', justifyContent: 'center', padding: '20px 0' }}>
        <HeaderNavigation />
      </div>

      {/* Main Content */}
      <div style={{ flexGrow: 1, display: 'flex', flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', width: '100%', maxWidth: '1440px', padding: '0 20px' }}>
        {/* Hero Section */}
        <div style={{ flexGrow: 1, maxWidth: '636px' }}>
          <HeroSection />
        </div>

        {/* Car Image */}
        <div style={{ flexGrow: 1, maxWidth: '1048px', display: 'flex', justifyContent: 'flex-end' }}>
          <CarImage />
        </div>
      </div>

      {/* Info Section */}
      <div style={{ width: '100%', display: 'flex', justifyContent: 'center', padding: '20px 0' }}>
        <InfoSection />
      </div>
    </div>
  );
};

export default Layout;
